import useLocalState from "./useLocalState";

export default function useOptionClicked(
  optionID: number,
  quizID: number,
  userID: number
) {
  const handleClick = () => {
    console.log(`${userID} has clicked option: ${optionID} of quiz: ${quizID}`);
  };

  return [handleClick];
}
